import React from 'react';
import ReactDOM from 'react-dom';


const App = () => {
  const course = 'Half Stack -sovelluskehitys'
  const part1 = 'Reactin perusteet'
  const exercises1 = 10
  const part2 = 'Tiedonvälitys propseilla'
  const exercises2 = 7
  const part3 = 'Komponenttien tila'
  const exercises3 = 14

  return (
    <div>
      <Header course={course} />
      <Header part1={part1} exercises1={exercises1}
         part2={part2} exercises2={exercises2} part3={part3}
         exercises3={part3}/>
       <Content exercises1={exercises1} exercises2={exercises2} exercises3={exercises3} />
    </div>
  )
}

const Header = (props) => {
    <h1>{props.course}</h1>
}

const Content = (props) => {
  <p>yhteensä {exercises1 + exercises2 + exercises3} tehtävää</p>

}

ReactDOM.render(<App />, document.getElementById('root'))
